import React, {Component} from 'react'
import './style.css'

class Navbar extends Component {
    constructor() {
        super()
        this.state = {
           home:"black",
           email:"black",
           machine:"black"
        }
    }
    changeTextColor=()=>{
        this.setState
    }
    render(){
        return (
            <div id ='navbar'>
                <img className="header" src={"./CertifiedAtmsLogo.png"}/>
                <span className="tabs" id="home" onClick={() => this.props.changeComponent('Home')} style={{color: this.state.bgcolor}} onClick={()=>this.changeTextColor()}>Home |</span>
                <span className="tabs" id="email" onClick={() => this.props.changeComponent('Email')}>Email |</span>
                <span className="tabs" id="machine" onClick={() => this.props.changeComponent("Machine")}>Machines |</span>
            </div>
        )
    }
}



export default Navbar;
